import React from "react";
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
} from "chart.js";
import { Line } from "react-chartjs-2";
import faker from "faker";
import { useState } from "react/cjs/react.production.min";

ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend
);

export const options = {
  responsive: true,
  plugins: {
    legend: {
      position: "top",
    },
    title: {
      display: true,
      text: "Hourly forecast",
    },
  },
};

const labels = ["January", "February", "March", "April", "May", "June", "July"];


function Chart({ xAxis, yAxis }) {
  // const [xAxisData,setXAxisData]= useState([])

  // const newData= xAxis.map((res)=> console.log(res.dt))
  // console.log("8888888888888888888888888888888888",newData)
  console.log("11111", xAxis);
  const data = {
    labels,
    datasets: [
      {
        label: "Dataset 1",
        data: labels.map(() => faker.datatype.number({ min: -1000, max: 1000 })),
        borderColor: "rgb(255, 99, 132)",
        backgroundColor: "rgba(255, 99, 132, 0.5)",
      },
    ],
  };
  return (
    <div>  <Line options={options} data={data} />
</div>
  );
}

export default Chart;
